import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Home from './Home';

function App() {
  return (
      <Router>
        <Routes>
          <Route path="/">
            <div>Test</div>
            <Home />
          </Route>
        </Routes>
      </Router>
  );
}

export default App;
